import React, { Component } from 'react'
import {Form, FormGroup, Label} from 'reactstrap'

export default class WordForm extends Component {
    render() {
        return (
            <div>
                <Form>
                    <FormGroup>
                        <Label>Keyword: </Label>
                    </FormGroup>
                </Form>
            </div>
        )
    }
}
